Start the gateway server: aisopod gateway The gateway will start on http://127.0.0.1:3000. Using cURL curl http://localhost:3000/v1/chat/completions \ -H "Content-Type: application/json" \ -d '{"messages": [{"role": "user", "content": "Hello!"}]}' Using JavaScript const response = await fetch('http://localhost:3000/v1/chat/completions', { method: 'POST', headers: { 'Content-Type': 'application/json' }, body: JSON.stringify({ messages: [{ role: 'user', content: 'Hello!' }] })
});
const data = await response.json();
console.log(data.choices[0].message.content);
